import './App.css';
import AboutUsSection from '../InforamtionSections/AboutUsSection';
import ProblematicSection from '../InforamtionSections/ProblematicSection';

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <AboutUsSection />
          <ProblematicSection />
      </header>
    </div>
  );
}

export default App;
